import React from "react";

function ImageAndText(props) {
  for (const d in props.data) {
    if (Array.isArray(props.data[d])) {
    return props.data[d] = props.data[d]
    }
  }

  return (
    <div className={props.data.class == null ? "content" : props.data.class}>
      <div
        className={props.data.wrapper == null ? "wrapper" : props.data.wrapper}
      >
        <h1
          className={props.data.headingClass == null ? "intro" : props.data.headingClass}
        >
          {props.data.heading}
        </h1>
        <section
          className={props.data.sectionClass == null ? "p-intro" : props.data.sectionClass}
        >
          {props.data.section}
        </section>
      </div>
      {props.data.source !== null ? (
        <img src={props.data.source} className={props.data.imgClass == null ? "img1" : `${[...props.data.imgClass]}`} />
      ) : (
        ""
      )}
    </div>
  );
}

export default ImageAndText;
